import 'package:flutter/foundation.dart';

class PreVisitReport {
  final String id;
  final DateTime createdAt;
  final String patientId;
  final String doctorId;
  final Map<String, dynamic> identification;
  final Map<String, dynamic> reasonForVisit;
  final Map<String, dynamic> symptoms;
  final Map<String, dynamic> conditions;
  final Map<String, dynamic> patientGoals;
  final Map<String, dynamic> consent;
  final List<String> attachments;

  PreVisitReport({
    required this.id,
    required this.createdAt,
    required this.patientId,
    required this.doctorId,
    required this.identification,
    required this.reasonForVisit,
    required this.symptoms,
    required this.conditions,
    required this.patientGoals,
    required this.consent,
    required this.attachments,
  });

  Map<String, dynamic> toJson() {
    return {
      'id': id,
      'createdAt': createdAt.toIso8601String(),
      'patientId': patientId,
      'doctorId': doctorId,
      'identification': identification,
      'reasonForVisit': reasonForVisit,
      'symptoms': symptoms,
      'conditions': conditions,
      'patientGoals': patientGoals,
      'consent': consent,
      'attachments': attachments,
    };
  }

  factory PreVisitReport.fromJson(Map<String, dynamic> json) {
    return PreVisitReport(
      id: json['id'],
      createdAt: DateTime.parse(json['createdAt']),
      patientId: json['patientId'],
      doctorId: json['doctorId'],
      identification: json['identification'],
      reasonForVisit: json['reasonForVisit'],
      symptoms: json['symptoms'],
      conditions: json['conditions'],
      patientGoals: json['patientGoals'],
      consent: json['consent'],
      attachments: List<String>.from(json['attachments']),
    );
  }
}
